import React from 'react'
import styled from 'styled-components'

const Wrapper = styled.div`
  padding: 50px 100px 50px 0;

  img {
    height: 50px;
    width: 50px;
    border-radius: 100%;
    border: 1px solid rgba(0,0,0,0.1);
  }

  h1 {
    font-size: 30px;
  }
`

const Column = styled.div`
  background: #fff;
  height: 100vh;
  overflow: scroll;

  &:last-child {
    background: #000;
  }
`

const Main = styled.div`
  left-padding: 50px;
`

const Header = (props) => {
  const {market_price, package_type, period, real_price, title, discount, desc, watch_num} = props.attributes

  return (
    <Wrapper>
      <h1>{title}</h1>
      <div>
        <div className="package-type">{package_type}</div>
        <div className="watch-num">{watch_num}</div>
        <div className="market-price">{market_price}</div>
        <div className="real-price">{real_price}</div>
        <div className="desc">{desc}</div>
      </div>
    </Wrapper>
  )
}

export default Header
